import React, {Component} from 'react'

class Addphoto extends Component{
    constructor(){
        super()
        this.handleSubmit = this.handleSubmit.bind(this)
    }

    handleSubmit(event){
        event.preventDefault()
        console.log(event.target.element.imgurl.value)
        console.log(event.target.element.description.value)

    }
    render(){
        return (
        <div>
            <h1>Place to add new photos</h1>
            <form> 
                <title className='imgDescribe'>Photo Link</title>
                <input type='text' placeholder='URL Link' name='imgurl'/>
                <input type='text' placeholder='Description' name ='description'/>
                <button onClick = {this.handleSubmit}>Post</button>

            </form>
        </div>
        )
    }
}

export default Addphoto
